import React, { Component } from 'react';
//引入组件
import { Select } from 'antd';
//引入css文件
import './style.css';
//从组件中引入组件
const { Option } = Select;

class Content_first extends Component {
    constructor(props) {
        super(props);
        this.state = {
            events: [],
            attrs: []
        }
    }

    mapRenderOption = () => {
        return this.props.events.map(item => {
            return (
                <Option key={item.id}>{item.name}</Option>
            )
        })
    }

    render() {
        console.log(this.props)
        return (
            <div className='eventComponent'>
                <span className='secondarytitle'>目标转化事件：</span>
                <Select
                    className='select'
                    defaultValue={this.state.events[0]}
                    style={{ width: 120 }}
                >
                    {this.mapRenderOption()};
                </Select>
                <Select
                    className='select'
                    defaultValue="lucy"
                    style={{ width: 120 }}>
                    <Option value="jack">Jack</Option>
                    <Option value="lucy">Lucy</Option>
                    <Option value="Yiminghe">yiminghe</Option>
                </Select>
            </div>
        )
    }

}

export default Content_first;
